import { useState } from "react";

function SidePanel(props)
{
    const [toggle1, setToggle1] = useState(true)
    const [toggle2, setToggle2] = useState(true)
    const [toggle3, setToggle3] = useState(true)
    const [toggle4, setToggle4] = useState(true)

    let objects = new Array();


    function filter3()
    {
        setToggle3(!toggle3)
        if(toggle3)
        {
            props.props.map((val)=>{
                if(val.price >= 100 && val.price < 1000)
                {
                    objects.push(val)
                }
            })
            return props.getState(objects)
        }
        return props.getState(props.props)
    }

    function filter()
    {
        let cb1 = document.getElementById("cb1").value;
        let cb2 = document.getElementById("cb2").value;
        let cb3 = document.getElementById("cb3").value;
        let cb4 = document.getElementById("cb4").value;

        if(!cb1 && !cb2 && !cb3 && !cb4)
        {
            return props.getState(props.props)
        }
        if(cb3)
        {
            filter3()
        }

    }

    return (
        <div class="col-2">
            <h5>Filter on price</h5>
            <input type="checkbox" id="cb1" class="form-check-input"/> <span>0-50</span> <br/>
            <input type="checkbox" id="cb2" class="form-check-input"/> <span>50-100 </span> <br/>
            <input type="checkbox" id="cb3" class="form-check-input" onClick={filter}/> <span>100-1000</span> <br/>
            <input type="checkbox" id="cb4" class="form-check-input"/> <span>&gt; 1000</span><br/>
        </div>
    )
}

export default SidePanel;
